import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Product() {
  const [products, setProducts] = useState([]);
  const [formData, setFormData] = useState({ name: '', price: '', quantity: '' });
  const [selectedId, setSelectedId] = useState(null);

  useEffect(() => {
    fetchProducts();
  }, []);

  const fetchProducts = async () => {
    try {
      const res = await axios.get('http://localhost:5000/api/products');
      setProducts(res.data);
    } catch (err) {
      alert('Failed to fetch products');
    }
  };

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleAdd = async () => {
    if (!formData.name || !formData.price || !formData.quantity) {
      alert('Please fill all fields');
      return;
    }
    try {
      await axios.post('http://localhost:5000/api/products', {
        ...formData,
        price: Number(formData.price),
        quantity: Number(formData.quantity)
      });
      setFormData({ name: '', price: '', quantity: '' });
      fetchProducts();
      alert('Product added');
    } catch {
      alert('Failed to add product');
    }
  };

  const handleUpdate = async () => {
    if (!selectedId) {
      alert('Select a product first');
      return;
    }
    if (!formData.name || !formData.price || !formData.quantity) {
      alert('Please fill all fields');
      return;
    }
    try {
      await axios.put(`http://localhost:5000/api/products/${selectedId}`, {
        ...formData,
        price: Number(formData.price),
        quantity: Number(formData.quantity)
      });
      setFormData({ name: '', price: '', quantity: '' });
      setSelectedId(null);
      fetchProducts();
      alert('Product updated');
    } catch {
      alert('Failed to update product');
    }
  };

  const handleDelete = async () => {
    if (!selectedId) {
      alert('Select a product first');
      return;
    }
    try {
      await axios.delete(`http://localhost:5000/api/products/${selectedId}`);
      setFormData({ name: '', price: '', quantity: '' });
      setSelectedId(null);
      fetchProducts();
      alert('Product deleted');
    } catch {
      alert('Failed to delete product');
    }
  };

  const handleSelect = (product) => {
    setFormData({
      name: product.name,
      price: product.price,
      quantity: product.quantity
    });
    setSelectedId(product._id);
  };

  const handleClear = () => {
    setFormData({ name: '', price: '', quantity: '' });
    setSelectedId(null);
  };

  return (
    <div>
      <h2>Product Management</h2>
      <input name="name" value={formData.name} onChange={handleChange} placeholder="Name" />
      <input
        name="price"
        value={formData.price}
        onChange={handleChange}
        placeholder="Price"
        type="number"
        min="0"
      />
      <input
        name="quantity"
        value={formData.quantity}
        onChange={handleChange}
        placeholder="Quantity"
        type="number"
        min="0"
      />
      <button onClick={handleAdd}>Add</button>
      <button onClick={handleUpdate} disabled={!selectedId}>Update</button>
      <button onClick={handleDelete} disabled={!selectedId}>Delete</button>
      <button onClick={handleClear}>Clear</button>

      <table border="1" cellPadding="10" style={{ marginTop: 20 }}>
        <thead>
          <tr><th>Name</th><th>Price</th><th>Quantity</th><th>Select</th></tr>
        </thead>
        <tbody>
          {products.map(product => (
            <tr key={product._id}>
              <td>{product.name}</td>
              <td>{product.price}</td>
              <td>{product.quantity}</td>
              <td><button onClick={() => handleSelect(product)}>Select</button></td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default Product;
